BEGIN;
DROP TABLE IF EXISTS public.orders CASCADE;
DROP TABLE IF EXISTS public.people CASCADE;
DROP TABLE IF EXISTS public.reviews CASCADE;
DROP TABLE IF EXISTS public.products CASCADE;

CREATE TABLE public.people (
  id int8 NOT NULL,
  address varchar(255) NULL,
  email varchar(255) NULL,
  "password" varchar(255) NULL,
  "name" varchar(255) NULL,
  city varchar(255) NULL,
  longitude float8 NULL,
  state bpchar(2) NULL,
  "source" varchar(255) NULL,
  birth_date date NULL,
  zip bpchar(5) NULL,
  latitude float8 NULL,
  created_at timestamp NULL,
  CONSTRAINT people_pkey PRIMARY KEY (id)
);

CREATE TABLE public.products (
  id int8 NOT NULL,
  ean bpchar(13) NULL,
  title varchar(255) NULL,
  category varchar(255) NULL,
  vendor varchar(255) NULL,
  price float8 NULL,
  rating float8 NULL,
  created_at timestamp NULL,
  CONSTRAINT products_pkey PRIMARY KEY (id)
);

CREATE TABLE public.orders (
  id int8 NOT NULL,
  user_id int4 NULL,
  product_id int4 NULL,
  subtotal float8 NULL,
  tax float8 NULL,
  total float8 NULL,
  discount float8 NULL,
  created_at timestamp NULL,
  quantity int4 NULL,
  CONSTRAINT orders_pkey PRIMARY KEY (id),
  CONSTRAINT fk_orders_product_id_products FOREIGN KEY (product_id) REFERENCES public.products(id),
  CONSTRAINT fk_orders_user_id_people FOREIGN KEY (user_id) REFERENCES public.people(id)
);

CREATE TABLE public.reviews (
  id int8 NOT NULL,
  product_id int4 NULL,
  reviewer varchar(255) NULL,
  rating int2 NULL,
  body text NULL,
  created_at timestamp NULL,
  CONSTRAINT reviews_pkey PRIMARY KEY (id),
  CONSTRAINT fk_reviews_product_id_products FOREIGN KEY (product_id) REFERENCES public.products(id)
);



COMMIT;
